type defaultPort struct {
	Name  string  `json:"name"`
	Guess float64 `json:"guess"`
	Port  int     `json:"port"`
}

var TCPDefault = make(map[int][]defaultPort)
var UDPDefault = make(map[int][]defaultPort)

func init() {
	var tcp []defaultPort
	_ = json.Unmarshal([]byte(defaultTCPPort), &tcp)
	for _, t := range tcp {
		if r, ok := TCPDefault[t.Port]; ok {
			TCPDefault[t.Port] = append(r, t)
		} else {
			TCPDefault[t.Port] = []defaultPort{t}
		}
	}

	var udp []defaultPort
	_ = json.Unmarshal([]byte(defaultUDPPort), &udp)
	for _, t := range udp {
		if r, ok := UDPDefault[t.Port]; ok {
			UDPDefault[t.Port] = append(r, t)
		} else {
			UDPDefault[t.Port] = []defaultPort{t}
		}
	}
}

func GetDefaultTCPServiceName(port int) string {
	results, ok := TCPDefault[port]
	if !ok {
		return ""
	} else {
		raw := funk.Map(results, func(i defaultPort) string {
			return i.Name
		})
		return strings.Join(raw.([]string), "/")
	}
}

func GetDefaultUDPServiceName(port int) string {
	results, ok := UDPDefault[port]
	if !ok {
		return ""
	} else {
		raw := funk.Map(results, func(i defaultPort) string {
			return i.Name
		})
		return strings.Join(raw.([]string), "/")
	}
}
